import React from 'react';
import { createRoot } from 'react-dom/client';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'; // Changed Routes to Switch
import App from './App';
import GateEntryPage from './components/GateEntryPage'; // Import GateEntryPage component
import Step1 from './components/Step1'; // Import Step1 component
import Step2 from './components/Step2'; // Import Step2 component
import reportWebVitals from './reportWebVitals';
import './components/App.css';
const root = createRoot(document.getElementById('root'));
root.render(
  <Router>
    <Switch> {/* Changed from Routes to Switch */}
      <Route path="/gate-entry" component={GateEntryPage} />
      <Route path="/step1" component={Step1} />
      <Route path="/step2" component={Step2} />
      <Route path="/" component={App} />
    </Switch>
  </Router>
);

export default App; // Export App as default
